import React, { useState, useEffect } from 'react'
import axios from 'axios'

const App = () => {
  const [countries, setCountries] = useState([])

  useEffect(() => {
    axios
      .get('TODO')
      .then(response => {
        setCountries(response.data)
      })
  }, [])

  return (
    <>
      <div>
        <input />
      </div>
    </>
  )
}

export default App
